`,y.jsx(r.p,{children:"The year is 2021, and COVID-19 just struck my country. 15 year old me went to my native village, and I got trapped. I can no longer travel back to home due to lockdown restrictions. Figuring ways to pass my time, I decided to try make my own game. I did not have a computer at that time, so I had to resort to my Mom's mobile phone. I used an Android app (whose name I cannot remember anymore), and built a small game. Just a really tiny shooter game."}),`
